import { 
  PUT_SNIPPETS
} from './actions';

import store from '../index';

const initialState = {
  snippetsList: {},
};

export const snippetReduser = (state = initialState, action) => {
  switch (action.type) {
    case PUT_SNIPPETS: 
      return {
        snippets: action.payload
      }

    default: return state;  
  }
}
